INSERT INTO directus_revisions VALUES(473,549,'features','0169b064-8459-45ab-9dc3-1bcebbf23675','{"warranty":true,"tow_bar":false,"auxilliary_heater":false,"keyless":true,"parking_cam_360":true,"adaptive_cruise_control":true,"panoramic_roof":true,"massaging_seats":false,"air_suspension":false,"heated_steering_wheel":false,"soft_close":false,"blind_spot_monitoring":true,"lane_keeping_assist":true,"ventilated_seats":true,"power_liftgate":true,"heated_seats":true}','{"warranty":true,"tow_bar":false,"auxilliary_heater":false,"keyless":true,"parking_cam_360":true,"adaptive_cruise_control":true,"panoramic_roof":true,"massaging_seats":false,"air_suspension":false,"heated_steering_wheel":false,"soft_close":false,"blind_spot_monitoring":true,"lane_keeping_assist":true,"ventilated_seats":true,"power_liftgate":true,"heated_seats":true}',497,NULL);
INSERT INTO directus_revisions VALUES(474,550,'overview','7accfb8c-8b13-4f88-b79d-e895f6c1541c','{"overview_text":"e Mercedes-AMG C 63 S E-Performance ranks among the most powerful and fastest mid-size cars. The plug-in hybrid system supplies all four wheels with 680 horsepower and 1020 Nm of torque. Under the hood is a 2.0-liter four-cylinder engine with an electric turbocharger, which in its weaker version can be found in the AMG A 45 S. Its output is 476 horsepower and 545 Nm, which made it the most powerful four-cylinder in a production car when introduced.\nThe engine works with a nine-speed AMG Speedshift MCT transmission. There is an electronically controlled differential at the rear. The electric motor with its own two-speed transmission and 6.1 kWh battery produces up to 204 horsepower. Unusually, the electric motor can rotate the drive shaft, so it powers all four wheels even in electric mode.\nIn today''s world, a rear-wheel steering system is a must. Below 100 km/h, it turns up to 2.5 degrees in the opposite direction of the front wheels. Above 100 km/h, it turns up to 0.7 degrees in the same direction as the front wheels. Six-piston brakes accompanied by the regenerating electric motor (with power up to 150 kW) handle the stopping power. Adaptive dampers come as standard. It accelerates from 0 to 100 km/h in 3.4 seconds and reaches a maximum speed of 280 km/h."}','{"overview_text":"e Mercedes-AMG C 63 S E-Performance ranks among the most powerful and fastest mid-size cars. The plug-in hybrid system supplies all four wheels with 680 horsepower and 1020 Nm of torque. Under the hood is a 2.0-liter four-cylinder engine with an electric turbocharger, which in its weaker version can be found in the AMG A 45 S. Its output is 476 horsepower and 545 Nm, which made it the most powerful four-cylinder in a production car when introduced.\nThe engine works with a nine-speed AMG Speedshift MCT transmission. There is an electronically controlled differential at the rear. The electric motor with its own two-speed transmission and 6.1 kWh battery produces up to 204 horsepower. Unusually, the electric motor can rotate the drive shaft, so it powers all four wheels even in electric mode.\nIn today''s world, a rear-wheel steering system is a must. Below 100 km/h, it turns up to 2.5 degrees in the opposite direction of the front wheels. Above 100 km/h, it turns up to 0.7 degrees in the same direction as the front wheels. Six-piston brakes accompanied by the regenerating electric motor (with power up to 150 kW) handle the stopping power. Adaptive dampers come as standard. It accelerates from 0 to 100 km/h in 3.4 seconds and reaches a maximum speed of 280 km/h."}',497,NULL);
