ystem supplies all four wheels with 680 horsepower and 1020 Nm of torque. Under the hood is a 2.0-liter four-cylinder engine with an electric turbocharger, which in its weaker version can be found in the AMG A 45 S. Its output is 476 horsepower and 545 Nm, which made it the most powerful four-cylinder in a production car when introduced.\nThe engine works with a nine-speed AMG Speedshift MCT transmission. There is an electronically controlled differential at the rear. The electric motor with its own two-speed transmission and 6.1 kWh battery produces up to 204 horsepower. Unusually, the electric motor can rotate the drive shaft, so it powers all four wheels even in electric mode.\nIn today''s world, a rear-wheel steering system is a must. Below 100 km/h, it turns up to 2.5 degrees in the opposite direction of the front wheels. Above 100 km/h, it turns up to 0.7 degrees in the same direction as the front wheels. Six-piston brakes accompanied by the regenerating electric motor (with power up to 150 kW) handle the stopping power. Adaptive dampers come as standard. It accelerates from 0 to 100 km/h in 3.4 seconds and reaches a maximum speed of 280 km/h."},"features":{"warranty":true,"tow_bar":false,"auxilliary_heater":false,"keyless":true,"parking_cam_360":true,"adaptive_cruise_control":true,"panoramic_roof":true,"massaging_seats":false,"air_suspension":false,"heated_steering_wheel":false,"soft_close":false,"blind_spot_monitoring":true,"lane_keeping_assist":true,"ventilated_seats":true,"power_liftgate":true,"heated_seats":true},"make":"mercedes-benz","model":"C63S AMG","year":2024,"mileage":8670,"price":2599000,"engine_specs":{"horsepower":670,"displacement":1991,"cylinders":4},"body_type":"station_wagon","engine_type":"hybrid"}',NULL,NULL);
INSERT INTO directus_revisions VALUES(498,574,'overview','7accfb8c-8b13-4f88-b79d-e895f6c1541c','{"id":"7accfb8c-8b13-4f88-b79d-e895f6c1541c","sort":null,"user_created":"7f6a45a2-5d78-4286-bb72-a694ab23085b","date_created":"2025-03-19T18:14:19.007Z","user_updated":"7f6a45a2-5d78-4286-bb72-a694ab23085b","date_updated":"2025-03-19T18:15:31.000Z","overview_text":"The Mercedes-AMG C 63 S E-Performance ranks among the most powerful and fastest mid-size cars. The plug-in hybrid system supplies all four wheels with 680 horsepower and 1020 Nm of torque. Under the hood is a 2.0-liter four-cylinder engine with an electric turbocharger, which in its weaker version can be found in the AMG A 45 S. Its output is 476 horsepower and 545 Nm, which made it the most powerful four-cylinder in a production car when introduced.\n\nThe engine works with a nine-speed AMG Speedshift MCT transmission. There is an electronically controlled differential at the rear. The electric motor with its own two-speed transmission and 6.1 kWh battery produces up to 204 horsepower. Unusually, the electric motor can rotate the drive shaft, so it powers all four wheels even in electric mode.\n\nIn today''s world, a rear-wheel steering system is a must. Below 100 km/h, it turns up to 2.5 degrees in the opposite direction of the front wheels. Above 100 km/h, it turns up to 0.7 degrees in the same direction as the front wheels. Six-piston brakes accompanied by the regenerating electric motor (with power up to 150 kW) handle the stopping power. Adaptive dampers come as standard. It accelerates from 0 to 100 km/h in 3.4 seconds and reaches a maximum speed of 280 km/h.","car_listings_id":["a227a9ad-7152-4e35-8d94-48d3befbdf0b"]}','{"overview_text":"The Mercedes-AMG C 63 S E-Performance ranks among the most powerful and fastest mid-size cars. The plug-in hybrid system supplies all four wheels with 680 horsepower and 1020 Nm of torque. Under the hood is a 2.0-liter four-cylinder engine with an electric turbocharger, which in its weaker version can be found in the AMG A 45 S. Its output is 476 horsepower and 545 Nm, which made it the most powerful four-cylinder in a production car when introduced.\n\nThe engine works with a nine-speed AMG Speedshift MCT transmission. There is an electronically controlled differential at the rear. The electric motor with its own two-speed transmission and 6.1 kWh battery produces up to 204 horsepower. Unusually, the electric motor can rotate the drive shaft, so it powers all four wheels even in electric mode.\n\nIn today''s world, a rear-wheel steering system is a must. Below 100 km/h, it turns up to 2.5 degrees in the opposite direction of the front wheels. Above 100 km/h, it turns up to 0.7 degrees in the same direction as the front wheels. Six-piston brakes accompanied by the regenerating electric motor (with power up to 150 kW) handle the stopping power. Adaptive dampers come as standard. It accelerates from 0 to 100 km/h in 3.4 seconds and reaches a maximum speed of 280 km/h.","user_updated":"7f6a45a2-5d78-4286-bb72-a694ab23085b","date_updated":"2025-03-19T18:15:31.000Z"}',499,NULL);
