INSERT INTO directus_revisions VALUES(522,598,'overview','73d5a739-87aa-4de2-b8b8-ab4c15e4d8d3','{"overview_text":"Volkswagen Passat Alltrack\nThe Volkswagen Passat Alltrack is a versatile all-wheel drive wagon combining everyday practicality with off-road capability. This 4MOTION model features a powerful 2.0-liter (1,968 cc) TDI diesel engine delivering 140 kW (190 horsepower), paired with a smooth-shifting DSG automatic transmission.\n\nIn operation since March 2017, this particular vehicle has recorded 79,560 kilometers on its odometer. The Alltrack comes equipped with Adaptive Cruise Control (ACC), enhancing both safety and comfort during long highway journeys.\n\nThe 4x4 drivetrain provides excellent traction in various weather and road conditions, making it ideal for both family use and adventure seekers. The Passat Alltrack offers a perfect balance of German engineering, spacious interior, and all-terrain performance in a refined package."}','{"overview_text":"Volkswagen Passat Alltrack\nThe Volkswagen Passat Alltrack is a versatile all-wheel drive wagon combining everyday practicality with off-road capability. This 4MOTION model features a powerful 2.0-liter (1,968 cc) TDI diesel engine delivering 140 kW (190 horsepower), paired with a smooth-shifting DSG automatic transmission.\n\nIn operation since March 2017, this particular vehicle has recorded 79,560 kilometers on its odometer. The Alltrack comes equipped with Adaptive Cruise Control (ACC), enhancing both safety and comfort during long highway journeys.\n\nThe 4x4 drivetrain provides excellent traction in various weather and road conditions, making it ideal for both family use and adventure seekers. The Passat Alltrack offers a perfect balance of German engineering, spacious interior, and all-terrain performance in a refined package."}',545,NULL);
