INSERT INTO directus_revisions VALUES(567,643,'overview','35ed7308-c8ff-44d4-9347-83244fa458c6','{"overview_text":"The Mini Cooper SE is a stylish all-electric city car that combines classic Mini charm with modern zero-emission technology. In operation since December 2021, this particular Czech-market model has only 30,824 kilometers on the odometer.\n\nThis electric Mini delivers a spirited 135 kW (184 horsepower) of power to its front wheels with the traditional 4x2 drivetrain configuration. Being fully electric, it has no engine displacement (0 ccm) and runs exclusively on electric power.\n\nThe SE model comes well-equipped with premium features including Apple CarPlay integration, built-in navigation system, and striking LED lighting. Its compact dimensions make it perfect for urban environments, while still offering the engaging driving dynamics Mini is known for.\nThe Cooper SE represents Mini''s successful transition into the electric vehicle market, maintaining the brand''s fun-to-drive character while embracing sustainable mobility."}','{"overview_text":"The Mini Cooper SE is a stylish all-electric city car that combines classic Mini charm with modern zero-emission technology. In operation since December 2021, this particular Czech-market model has only 30,824 kilometers on the odometer.\n\nThis electric Mini delivers a spirited 135 kW (184 horsepower) of power to its front wheels with the traditional 4x2 drivetrain configuration. Being fully electric, it has no engine displacement (0 ccm) and runs exclusively on electric power.\n\nThe SE model comes well-equipped with premium features including Apple CarPlay integration, built-in navigation system, and striking LED lighting. Its compact dimensions make it perfect for urban environments, while still offering the engaging driving dynamics Mini is known for.\nThe Cooper SE represents Mini''s successful transition into the electric vehicle market, maintaining the brand''s fun-to-drive character while embracing sustainable mobility."}',584,NULL);
