INSERT INTO directus_revisions VALUES(620,696,'overview','422224fd-2604-43b1-935e-fbec4c57138a','{"overview_text":"The Volkswagen Golf Variant is a practical and versatile station wagon that combines spaciousness with efficiency. This particular Czech model has been in operation since January 2022 and has covered just 38,065 kilometers.\n\nUnder the hood, it features a 1.5-liter (1,498 cc) eTSI gasoline engine producing 110 kW (150 horsepower), paired with a smooth DSG automatic transmission. The front-wheel drive (4x2) configuration offers excellent efficiency for everyday driving.\n\nThe eTSI mild hybrid technology enhances fuel economy while maintaining responsive performance. This Golf Variant comes with both warranty and service history documentation, providing peace of mind for the buyer.\n\nPriced at 549,000 CZK, this modern wagon delivers the renowned Golf driving experience with added cargo capacity, making it ideal for families or those requiring extra space without sacrificing driving dynamics or fuel efficiency."}','{"overview_text":"The Volkswagen Golf Variant is a practical and versatile station wagon that combines spaciousness with efficiency. This particular Czech model has been in operation since January 2022 and has covered just 38,065 kilometers.\n\nUnder the hood, it features a 1.5-liter (1,498 cc) eTSI gasoline engine producing 110 kW (150 horsepower), paired with a smooth DSG automatic transmission. The front-wheel drive (4x2) configuration offers excellent efficiency for everyday driving.\n\nThe eTSI mild hybrid technology enhances fuel economy while maintaining responsive performance. This Golf Variant comes with both warranty and service history documentation, providing peace of mind for the buyer.\n\nPriced at 549,000 CZK, this modern wagon delivers the renowned Golf driving experience with added cargo capacity, making it ideal for families or those requiring extra space without sacrificing driving dynamics or fuel efficiency."}',641,NULL);
